import React from "react";

function Home() {
  return (
    <div className="home">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
            <img
              className="img-fluid rounded mb-4 mb-lg-0"
              src="http://placehold.it/900x400"
              alt=""
            />
          </div>
          <p> Welcome to Professor Marvin - Your Simple and Effective Study Tool!</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
